import java.util.concurrent.CopyOnWriteArrayList;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArrayList<Integer> list = new CopyOnWriteArrayList<>();
        list.add(10); // Initial setup
        /* other operations */
        int a = (int) (Math.random() * 100);
        for (int i = 0; i < 5; i++) {
            list.add(a + i);
        }
        /* write */ list.add(99); // This affects the read point
        if (a % 2 == 0) {
            list.add(42);
        } else {
            list.add(43);
        }
        list.remove(0); // Misleading operation, doesn't affect read
        if (a % 3 == 0) {
            list.add(50);
            list.set(1, 200); // Attempted obfuscation
        }
        list.add(500); // More misleading operations
        list.remove(2);
        /* other operations */
        /* read */ int ret = list.get(1); // Reads the value written during the write point
        System.out.println("Retrieved value: " + ret);
    }
}
